  public static byte[] strToHex(String arg0) throws Exception{
    byte[] bit = new byte[8];
    for (int k = 0, kk = 0; k < arg0.length(); k += 2, kk++) {
      char tmp1 = arg0.charAt(k);
      char tmp2 = arg0.charAt(k + 1);
      bit[kk] = (byte) ( ( (tmp1 & 0x0f) << 4) | (tmp2 & 0x0f));
    }
    return bit;

  }

  
  
  
